import React from 'react';
import Card from '../MainCard/Card';
import Component1 from '../Item/Component1';
import './LargeComponent.css'
import FilterYear from '../YearFilterComponent/YearFilter';

function LargeComponent(props){
    option1 = [
        {id : 'e4' ,
        date : new Date (2019,11,14) ,
        title : 'Fan' ,
        price : 70}
    ];
    option2 = [
        {id : 'e3' ,
        date : new Date (2020,6,8) ,
        title : 'Fridge' ,
        price : 500 }
    ];
    option3 = [
        {id : 'e2' ,
        date : new Date (2021,4,15) ,
        title : 'Hand Blender' ,
        price : 45}
    ];
    option4 = [
        {id : 'e1' ,
        date : new Date (2022,2,26) ,
        title : 'Oven' ,
        price : 150},

        {id : 'e4' ,
        date : new Date (2022,9,7) ,
        title : 'Microwave' ,
        price : 200}
    ];

    return(
        <Card className="LargeComponent">
            <Component1 onOption1={option1Handler}/>
            <Component1 />
            <Component1/>
            <Component1/>
            <Component1/>
        </Card>
    );
}

export default LargeComponent;
